import axios from "axios";
import { GET_Quizz, DELETE_Quizz, ADD_Quizz } from "../types";
import { tokenConfig } from "../auth";
export const getQuizz = () => (dispatch, getState) => {
  //asy request with axios we are making here
  console.log(getState);
  axios
    .get("http://127.0.0.1:8000/api/quizz/", tokenConfig(getState))
    .then((res) => {
      console.log(res.data);
      dispatch({
        type: GET_Quizz, //in action we are passing type action.type
        payload: res.data,
      });
    })
    .catch((err) => console.log(err));
};
//delete plo
export const deleteQuizz = (id) => (dispatch, getState) => {
  axios
    .delete("http://localhost:8000/api/quizz/" + id, tokenConfig(getState))
    .then((res) => {
      dispatch({
        type: DELETE_Quizz,
        payload: id,
      });
    })
    .catch((err) => console.log(err));
};
//ADD plo
export const addQuizz = (quizz) => (dispatch, getState) => {
  axios
    .post("http://127.0.0.1:8000/api/quizz/", quizz, tokenConfig(getState))
    .then((res) => {
      dispatch({
        type: ADD_Quizz,
        payload: res.data,
      });
    })
    .catch((err) => console.log(err));
};
